package com.example.miner.model;  public class NodeJ {        public int key;        public String data;        public NodeJ left;        public NodeJ right;        /**         * Конструктор по умолчанию         */        public NodeJ() {        }        /**         * Конструктор, инициализирующий поля         */        public NodeJ(int key, String data) {            this.key = key;            this.data = data;            right = null;            left = null;        }        @Override        public String toString() {            return                    "key = " + key +" " +                            "data = " + data +" ";        }  }